Update email only if it doesn't already exist in mongoDB database<p>I'm using this route to allow a user to change their email address. However, it currently lets them add an email address that is already used by another user. How can I prevent this (and send an alert in this situation). Also, I'm wondering if .findOneAndUpdate() is appropriate here as it may stop after finding the first one.</p>
<p>Thanks</p>
<pre><code>app.post('/changeUserEmail', function (req, res) {

    db.collection(&quot;userDB&quot;).findOneAndUpdate(
      {username: req.user.username}, 
      { $set: {email: req.body.newEmail}}, 
      {new: true}, 
      (err, data) =&gt; {
      if (err) {
        console.log(err); 
        }
        console.log(null, data);
       }
      )
      res.render(process.cwd() + &quot;/views/options&quot;, {
        username: req.user.username,
        email: req.body.newEmail, 
        alert: &quot;Email changed&quot;
      });
});  
</code></pre>

