<pre><code>public class Event {

    @Id
    private String id;

    private String internalUuid;

    private EventType eventType;
}
</code></pre>
<p>EventType is an enum containing arbitrary event types:</p>
<pre><code>public enum EventType {
    ACCEPTED,
    PROCESSED,
    DELIVERED;
}
</code></pre>
<p>My problem is that I have a table with a lot of events, some having the same internalUuid but different statuses. I need to get a list of Events with each Event representing the 'newest' status (ordering by EventType would suffice). Currently, I'm just fetching everything, grouping to separates lists in code, sorting the lists by EventType and then just creating a new list with the first element of each list.</p>
<p>Example would be as follows.</p>
<p>Data in table:</p>
<pre><code>{ &quot;id&quot;: &quot;1&quot;, &quot;internalUuid&quot;: &quot;1&quot;, &quot;eventType&quot;: &quot;ACCEPTED&quot; },
{ &quot;id&quot;: &quot;2&quot;, &quot;internalUuid&quot;: &quot;1&quot;, &quot;eventType&quot;: &quot;PROCESSED&quot; },
